embly of 30S ribosomal subunit, possibly for assembly of the head region. Probably interacts with S19. Essential for efficient processing of 16S rRNA. May be needed both before and after RbfA during the maturation of 16S rRNA. It has affinity for free ribosomal 30S subunits but not for 70S ribosomes","Catalyzes the reversible epimerization of D-ribulose 5-phosphate to D-xylulose 5-phosphate","","Attaches a formyl group to the free amino group of methionyl-tRNA(fMet). The formyl group appears to play a dual role in the initiator identity of N-formylmethionyl-tRNA by promoting its recognition by IF2 and preventing the misappropriation of this tRNA by the elongation apparatus","Might take part in the signal recognition particle (SRP) pathway. This is inferred from the conservation of its genetic proximity to ftsY/ffh. May be a regulatory protein","","","","Required for a late step of 50S ribosomal subunit assembly. Has GTPase activity","Required for chromosome condensation and partitioning"],"GO terms: Biological process (P)":["P:cell wall organization; P:peptidoglycan biosynthetic process; P:regulation of cell shape","","","P:translation","P:translation","P:SRP-dependent cotranslational protein targeting to membrane","","P:rRNA processing; P:ribosomal small subunit biogenesis","P:pentose catabolic process; P:pentose-phosphate shunt","P:phosphorylation","","","P:proteolysis","P:D-xylose metabolic process; P:UDP-D-xylose biosynthetic process; P:nucleotide-sugar metabolic process","P:signal peptide processing","","P:DNA replication; P:chromosome condensation; P:sister chromatid cohesion"],"GO terms: Cellular component (C)":["C:cytoplasm","C:cytoplasm","C:cytoplasm","C:cytoplasm; C:ribonucleoprotein complex; C:ribosome","C:ribonucleoprotein complex; C:ribosome","C:signal recognition particle","","C:cytoplasm; C:ribosome","","C:integral component of membrane","","","C:integral component of membrane; C:plasma membrane","","C:integral component of membrane; C:membrane; C:pla
